import React, { useContext } from "react";
import { useNavigate } from "react-router-dom";
import "./UserProfilePage.css";
import mangoLogo from "../../assets/Logo_white.png";
import { UserContext } from "../../UserContext";

const UserProfilePage = () => {
  const navigate = useNavigate();
  const { userInfo } = useContext(UserContext);

  const handleEditUser = () => navigate("/edituserprofile");

  return (
    <div className="profile-page">
      {/* Navbar */}
      <nav className="profile">
        <div className="profile-brand">
          <img src={mangoLogo} alt="Mango Logo" className="manger-logo" />
        </div>
        {/* Add other navigation links */}
      </nav>

      {/* User Profile Content */}
      <div className="user-profile-content">
        <h2 className="profile-title">User Profile</h2>
        <div className="profile-container">
          <img
            src={userInfo.profileImage || "../../assets/profile.jpg"}
            alt="Profile"
            className="profile-userimage"
          />
          <div className="profile-info">
            <p>
              <strong>Name:</strong> {userInfo.name}
            </p>
            <p>
              <strong>Email:</strong> {userInfo.email}
            </p>
            {/* Add other user details */}
            <div className="profile-buttons">
              <button className="editer-button" onClick={handleEditUser}>
                Edit
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserProfilePage;
